const zlib = require('zlib');
const Buffer = require('buffer').Buffer;
let input = "";
// let encodedText = "0" + zlib.deflateSync(Buffer.from(decodedText,'utf8')).toString('base64');

let decodedText = zlib.inflateSync(Buffer.from(input, 'base64')).toString('utf8');
let blueprint = JSON.parse(decodedText);
let allKeyTypes = {};
blueprint.blueprint.entities.forEach( entity => {
	Object.keys(entity).forEach( key => {
		if(Object.keys(allKeyTypes).indexOf(key) < 0){
			allKeyTypes[key] = [];
		}
		if(allKeyTypes[key].indexOf(entity.name) < 0){
			allKeyTypes[key].push(entity.name);
		}
	});
});
console.log(JSON.stringify(blueprint, null, '\t'));
return;

