let edges = [];

keys.forEach( key => {
	if(valids.indexOf(key) < 0) return;
	let rec = recipesMap[key];
	rec.ingList.forEach( ing => edges.push([ing, key]));
});

let sorted = tsort(edges);
sorted = sorted.filter( key => doInclude(recipesMap[key]));

let sortedExtra = [];
sorted.forEach( key => {
	sortedExtra.push({
		name: key,
		ingList: recipesMap[key].ingList,
		ingFor: recipesMap[key].ingFor,
	});
});
